window.bookSummaryJSON = "<p><b>Nine to Five? Not for me. I’d rather make this magical house a home.</b></p> <p>My career as a realtor bored me, except for when I got to test my handyman skills. So, when I finally saved enough, I purchased the most rundown manor I could find.</p> <p>The problem? A few guests rest within its walls.</p> <p>Repairing the mansion is the challenge I craved, but a string of vandalisms keeps us on edge. Someone, or something, doesn’t want us living here.</p> <p>It turns out Sunnyside won’t be as peaceful as I expected.</p>"; 
